CREATE TABLE orders (
  orderid SERIAL PRIMARY KEY,
  customerid VARCHAR(45) NULL,
  employeeid INT NULL,
  orderdate TIMESTAMP NULL,
  requireddate TIMESTAMP NULL,
  shippeddate TIMESTAMP NULL,
  shipvia INT NULL,
  freight BIGINT NULL,
  shipname VARCHAR(45) NULL,
  shipaddress VARCHAR(50) NULL,
  shipcity VARCHAR(45) NULL,
  shipregion VARCHAR(20) NULL,
  shippostalcode VARCHAR(12) NULL,
  shipcountry VARCHAR(20) NULL
);


